export default function getDeviceData(data) {
  let profileList = [];

  data['data'].forEach(profile => {
    profileList.push([
      {
        type: "mac",
        index: "MAC Address",
        data: (() => {
          try {
            let destruct = profile['data']['name'].toUpperCase();
            return destruct ? destruct : "";
          }
          catch {return ""};
        })()
      },
      {
        type: "product",
        index: "Product",
        data: (() => {
          try {
            let destruct = profile['data']['product']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "user",
        index: "User ID",
        data: (() => {
          try {
            let destruct = profile['data']['ownerUserName']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "description",
        index: "Description",
        data: (() => {
          try {
            let destruct = profile['data']['description']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "primary",
        index: "Primary Line",
        data: (() => {
          try {
            let destruct = profile['data']['lines']['line'][0]['dirn']['pattern']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "mask",
        index: "E164 Mask",
        data: (() => {
          try {
            let destruct = profile['lines']['line'][0]['e164Mask']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      },
      {
        type: "location",
        index: "Location",
        data: (() => {
          try {
            let destruct = profile['meta']['hierarchy']
            return destruct ? destruct : ""
          }
          catch {return ""}
        })()
      }
    ])
  })

  return new Promise((resolve, reject) => {
    resolve(profileList)
    reject("Unable to retireve devices.")
  })
}
